import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Table() {
    const [users, setUsers] = useState([])
    useEffect(() => {
        axios.get('http://localhost:8000/get-users').then((response) => {
            console.log(response)
            setUsers(response.data)
        },[])
    })
    return (
        <div>
            <table>

  <tr>
    <th>Id</th>
    <th>name</th>
    <th>email</th>
  </tr>
  {users.map((data) => {
      return(<tr>
      <td>{data.id}</td>
      <td>{data.name}</td>
      <td>{data.email}</td>
    </tr>)
  })}

  <tr>
    <td>1</td>
    <td>Jackson</td>
    <td>@gmail.com</td>
  </tr>
</table>
        </div>
    )
}

export default Table
